import logo from '../../imagens/logo.svg'
import styled from 'styled-components'

const LogoConteiner = styled.div`
    display: flex;
    font-size: 30px;
    margin-right: 30px;
` 

const LogoImage = styled.img`
    margin-left: 2px;
`

function Logo(){
    return (
        <LogoConteiner>
          <LogoImage 
            src={logo} 
            alt='logo' 
            className='logo-img'
            />
          <p><strong>Livraria</strong>OneByte</p>
        </LogoConteiner>
    )
}

export default Logo;
